import React from 'react';
import styled from 'styled-components'
import Post from './components/Post/Post';

const MainContainer = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
`

class App extends React.Component {
  render() {
    return (
      <MainContainer>
        <Post
          nomeUsuario={'paulinha'}
          fotoUsuario={'https://picsum.photos/50/50'}
          fotoPost={'https://picsum.photos/200/150'}
        />

          <Post
          nomeUsuario={'karen'}
          fotoUsuario={'https://i.pinimg.com/originals/46/8d/36/468d36c8cfaa92434890a13cc42d61d4.jpg'}
          fotoPost={'https://i.picsum.photos/id/106/400/300.jpg?hmac=SvqCNCdfjOxOuTNbAZg_PkWS5RHHTUSV2056WKQGcdQ'}
        />

          <Post
          nomeUsuario={'joelam'}
          fotoUsuario={'https://i.pinimg.com/originals/c9/0c/70/c90c709dc4c37a2603c0e08de520bd64.jpg'}
          fotoPost={'https://i.picsum.photos/id/28/400/400.jpg?hmac=GimN6n4shCH8in5xKYxsTe8Tv0pwayxzLr9BkZB-P80'}
        />

      </MainContainer>

    );
  }
}

export default App;
